sys_variable_value.value:
(function execute(inputs, outputs) {
var payloadObject = JSON.parse(inputs.payload);
  var dataArray = payloadObject.result.data;
  var caseArray = [];
  for (i=0;i<dataArray.length;i++) {
    caseArray.push(parseInt(dataArray[i].cases));
  }
  outputs.case_array = caseArray;
})(inputs, outputs);

