sys_variable_value.value:
(function execute(inputs, outputs) {
var instanceURL = gs.getProperty('x_snc_vac_mfgr_lab.nytime.covid.instance');
if (instanceURL == '') {
 outputs.instance_url = 'https://mslabscdev01.service-now.com'; 
}
  else
    outputs.instance_url = instanceURL;
})(inputs, outputs);

